import { UserNav } from "../Navbar/homeNav"
import { getPrinter,getPrinters } from "../../data/data"

export default function MyPrinters(){

    const printers=getPrinters();
    let name=printers.map((elem)=><tr><td id={elem.name}>{elem.name}</td></tr>);
    let address=printers.map((elem)=><tr><td id={elem.address}>{elem.address}</td></tr>)
    return(
        <div className="containerMyprinters">
            <UserNav/>

            <h2>My printers</h2>
            <div className="printerTable">
                <table className="myPrinters">
                    <tbody>
                    <tr>
                        <th>Name</th>
                        <th>Address</th>
                        <th>Seleziona</th>
                    </tr> 
                        {printers.map((elem)=>{
                            return <tr><td id={elem.name}>{elem.name}</td></tr>

                        })}

                        {printers.map((elem)=>{
                           return <tr><td id={elem.address}>{elem.address}</td></tr>

                        })}

                        {printers.map((elem)=>{
                            return <tr><td><button id={elem.name+elem.address}className="printButton">Seleziona</button></td></tr>

                        })}
                   </tbody> 
                </table>
            </div>
        </div>
    )
}
